import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Dish from './components/Dish.js';
import Card from './components/Card.js';



const App = () => {

    const [data, setData] = useState(0);

    useEffect(() => {
        axios.get("https://www.themealdb.com/api/json/v1/1/search.php?s=beef").then((res) => setData(res.data.meals));
    }), [data];
    //console.log(data[0].strMeal);


    return (

        <div>
            <Dish />
            {data.map(() => (
                <Card name={data} />

            ))}
        </div>
    );
};

export default App;
